INSERT INTO `comics` VALUES (9,_binary '','Gosho Aoyama','Mở đầu câu truyện, cậu học sinh trung học 16 tuổi Shinichi Kudo bị biến thành cậu bé Conan Edogawa. Shinichi trong phần đầu của Thám tử lừng danh Conan được miêu tả là một thám tử học đường. Trong một lần đi chơi công viên \"Miền Nhiệt đới\" với cô bạn từ thuở nhỏ (cũng là bạn gái) Ran Mori , cậu bị dính vào vụ án một hành khách trên Chuyến tàu tốc hành trong công viên, Kishida , bị giết trong một vụ án cắt đầu rùng rợn. Cậu đã làm sáng tỏ vụ án và trên đường về nhà, chứng kiến một vụ làm ăn mờ ám\nĐây chỉ là một phần nhỏ trong hành trình của Thám Tử Conan – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-03 10:34:06.421229','Thám Tử Conan','Meitantei Conan; Detective Conan','ĐANG TIẾN HÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/tham-tu-conan.jpg','2024-12-18 22:27:50.412856'),(10,_binary '','Fujiko F. Fujio','Các câu chuyện trong Doraemon thường có một công thức chung, đó là xoay quanh những rắc rối hay xảy ra với cậu bé Nobita học lớp bốn, nhân vật chính thứ nhì của bộ truyện. Doraemon có một chiếc túi thần kỳ trước bụng với đủ loại bảo bối của tương lai. Cốt truyện thường gặp nhất sẽ là Nobita trở về nhà khóc lóc với những rắc rối mà cậu gặp phải ở trường hoặc với bạn bè. Sau khi bị cậu bé van nài hoặc thúc giục, Doraemon sẽ đưa ra một bảo bối giúp Nobita giải quyết những rắc rối của mình, hoặc là để trả đũa hay khoe khoang với bạn bè của cậu. Nobita sẽ lại thường đi quá xa so với dự định ban đầu của Doraemon, thậm chí với những bảo bối mới cậu còn gặp rắc rối lớn hơn trước đó. Đôi khi những người bạn của Nobita, thường là Suneo (Xêkô) hoặc Jaian (Chaien) lại lấy trộm những bảo bối và sử dụng chúng không đúng mục đích. Tuy nhiên thường thì ở cuối mỗi câu chuyện, những ai sử dụng sai mục đích bảo bối sẽ phải chịu hậu quả do mình gây ra, và người đọc sẽ rút ra được bài học từ đó\nĐây chỉ là một phần nhỏ trong hành trình của Doremon – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-03 10:51:34.722590','Doremon','Doremon','ĐANG TIẾN HÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/doremon.jpg','2024-12-03 10:51:34.722590'),(11,_binary '','Akira Toriyama','Câu truyện kể về một cậu bé tên Songoku cùng nhóm bạn của mình tham gia những chuyến phiêu lưu tìm ngọc rồng, chống lại cái ác bảo vệ trái đất. Nhân vật Songoku được mọi người ưa thích bởi tính thánh thiện và ngây ngô của mình. Câu truyện lôi cuốn người qua những tình huống phiêu lưu kì thú, những pha đấu võ đẹp mắt, và những tình huống hài hước. Dragon ball là bộ truyện tranh thuộc nhóm nổi tiếng nhất thế giới, được rất nhiều bạn trẻ ưa thích.\nĐây chỉ là một phần nhỏ trong hành trình của 7 Viên Ngọc Rồng – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-08 18:59:14.173135','7 Viên Ngọc Rồng','Dragon Ball','HOÀN THÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/7-vien-ngoc-rong.jpg','2024-12-08 20:37:29.256103'),(12,_binary '','Kusaka Hidenori','Bộ truyện nói về một cậu bé tên là Red và nhiều nhà thám hiểm pokemon khắc, là nhưng một nhà huấn luyện pokemon và được giáo sư Oak giao nhiệm vụ hoàn thành bộ Pokemon của mình, trên hành trình của họ gồm có Green, Blue.... và các loài Pokemon khác, đặc biệt là chú Pikachu của cậu ... họ phải đối mắt với nhiều nguy hiểm và vượt qua nhiều, âm mưu của tổ chức bí ẩn.\nĐây chỉ là một phần nhỏ trong hành trình của Pokemon Special – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-08 20:35:23.578372','Pokemon Special','Thú Cưng đặc biệt','ĐANG TIẾN HÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/pokemon-special.jpg','2024-12-08 20:40:12.898654'),(13,_binary '','Fujiko F. Fujio','Hẳn các bạn nhỏ Việt Nam đã không còn lạ lùng về bộ truyện này nhỉ. Một chú mèo máy sở hữu những bảo bối thần kì, một chú nhóc ngốc nghếch luôn bị điểm kém. Cùng với nhau, họ đã trở thành một đôi bạn tuyệt vời. Tựa đề mỗi câu chuyện là tên một món bảo bối, nhưng ý nghĩa thực sự trong đó lại vô cùng to lớn. Hãy cùng bước chân vào thế giới diệu kì.\nĐây chỉ là một phần nhỏ trong hành trình của Doraemon Plus – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-13 21:14:14.451227','Doraemon Plus','Doremon Plus','ĐANG TIẾN HÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/doraemon-plus.jpg','2024-12-13 21:14:14.450228'),(14,_binary '','Fujiko F. Fujio','Đây là phiên bản truyện tranh của Eiga Doraemon 2015, kể vệ nhóm bạn Nobita đóng phim làm siêu anh hùng. nhưng không ngờ lại được làm siêu anh hùng thật.\nĐây chỉ là một phần nhỏ trong hành trình của Doraemon - Nobita Và Những Hiệp Sĩ Không Gian – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-13 21:21:27.461441','Doraemon - Nobita Và Những Hiệp Sĩ Không Gian','Doremon - Nobita Và Những Hiệp Sĩ Không Gian','HOÀN THÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/doraemon-nobita-va-nhung-hiep-si-khong-gian.jpg','2024-12-13 21:21:27.461441'),(15,_binary '','Fujiko F. Fujio','Truyện được làm lại dựa trên bản dịch cũ của nhà xuất bản Trẻ do Ghost & Devil Team thực hiện.\nĐây chỉ là một phần nhỏ trong hành trình của Đôrêmon Truyện Dài – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-13 21:30:41.875465','Đôrêmon Truyện Dài','Đôrêmon Truyện Dài','ĐANG TIẾN HÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/doremon-truyen-dai-cover.jpg','2024-12-13 21:30:41.875465'),(16,_binary '','Fujiko F. Fujio','Bộ truyện được xem là huyền thoại của Nhật Bản. Nói về cuộc sống của một chú nhóc tên Nobita,tính tình hậu đậu,để từ đó gây ra bao tiếng cười cho người xem !!\nĐây chỉ là một phần nhỏ trong hành trình của Doremon - Chú Mèo Máy Thông Minh Đến Từ Tương Lai – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-18 00:02:24.907801','Doremon - Chú Mèo Máy Thông Minh Đến Từ Tương Lai','Doremon - Chú Mèo Máy Thông Minh Đến Từ Tương Lai','ĐANG TIẾN HÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/doremon-chu-meo-may-thong-minh-den-tu-tuong-lai-cover.jpg','2024-12-18 00:03:35.593002'),(17,_binary '','Đang cập nhật','Kudo Shinichi là một thám tử trung thỉnh thoảng giúp cảnh sát phá giải các vụ án.Trong một lần khi đang điều tra, cậu bị thành viên của Tổ chức Áo đen phát hiện. Chúng cho cậu uống thử loại độc dược tổ chức vừa điều chế ra nhưng chất độc này không giết chết cậu mà khiến cơ thể cậu trở thành hình dạng một đứa trẻ. Sau đó, cậu đổi tên thành Edogawa Conan sống tại nhà thám tử Mori Kogoro.Xuyên suốt xê-ri cậu âm thầm hỗ trợ phá các vụ án bên cạnh ông Mori. Đồng thời cậu cũng phải đi học lại tiểu học, kết bạn được nhiều người và lập ra Đội thám tử nhí .Về sau một học sinh tiểu học bất đắc dĩ khác tên là Haibara Ai tiết lộ rằng cô ấy chính là người đã tạo ra thuốc teo nhỏ .Vì muốn tách khỏi băng nhóm nên bị tổ chức cho uống thuốc như Kudo. Trong một vài vụ án liên quan đến Tổ chức Áo đen, Conan đã hỗ trợ các điệp viên của FBI và CIA.\nĐây chỉ là một phần nhỏ trong hành trình của Conan - Bộ Đặc Biệt – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-18 10:56:51.211814','Conan - Bộ Đặc Biệt','Conan - Bộ Đặc Biệt','ĐANG TIẾN HÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/conan-bo-dac-biet-cover.jpg','2024-12-18 14:02:18.884506'),(18,_binary '','Fujiko F. Fujio','Nối tiếp truyện Đôrêmon thêm (The Doraemons), truyện xoay quanh về cuộc phiêu lưu của Nobita và nhóm Doraemons sau khi 7 người bạn thân tốt nghiệp Trường học Robot và bắt đầu cuộc sống riêng mình. Mỗi tập truyện xoay quanh cuộc phiêu lưu của 8 người bạn và mẩu chuyện ngắn về Doraemon, Nobita cùng với một thành viên trong nhóm DoraemonsVì đây là scan từ bản cũ nên mọi người cứ đọc từ trái sang phải (trừ tập 5, 7, 8, 11 vì lấy từ bản mới nên đọc từ phải sang trái), truyện có thể không hay bằng nguyên tác Doraemon của Fujiko.F.Fujio nhưng mong mọi người sẽ có thời gian đọc truyện vui vẻ Mình đã hoàn thành việc thu thập cả 12 bộ và sẽ update luôn vì đã để nhiều bạn đọc phải chờ quá lâu\nĐây chỉ là một phần nhỏ trong hành trình của The Doraemon Special (Đội quân Doraemons Đặc Biệt+Đội quân Đôrêmon Thêm) – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-18 14:05:14.318343','The Doraemon Special (Đội quân Doraemons Đặc Biệt+Đội quân Đôrêmon Thêm)','The Doraemon Special (Đội quân Doraemons Đặc Biệt+Đội quân Đôrêmon Thêm)','ĐANG TIẾN HÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/the-doraemon-special-doi-quan-doraemons-dac-bietdoi-quan-doremon-them-cover.jpg','2024-12-18 14:05:14.318343'),(19,_binary '','Hidenori Kusaka','Pokemon Special ORAS là truyện về phần game Pokemon Omega Ruby Alpha Sapphire. Phần truyện này cùng nằm trong loạt truyện Pokemon Special, nội dung vẫn liên quan tới nhau và nối tiếp. Các bạn có thể coi Pokemon Special ORAS là trailer trước khi nối vào phần chính trong Pokemon Special.\nĐây chỉ là một phần nhỏ trong hành trình của Pokemon Special Oras – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.\n','2024-12-18 14:33:10.391476','Pokemon Special Oras','Pokemon Special Oras','ĐANG TIẾN HÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/pokemon-special-oras-cover.jpg','2024-12-18 14:33:10.391476'),(20,_binary '','Hidenori Kusaka','Truyện được chia thành nhiều Arc tương tự như trong Game là Red/Blue; Yellow; Gold/Silver; Crystal; Ruby/Sapphire; Fire Red/Leaf Green; Emerald và hiện giờ đang đến Arc mới nhất là Diamond và Pearl. Mỗi Arc lại kết nối mật thiết với nhau làm thành một bộ Manga Pokemon với rất nhiều nhân vật và Pokemon đa dạng. Với nội dung hoàn toàn khác so với Pokemon Anime, đây hứa hẹn là một trong những bộ truyện hay bạn nên xem ^_^ Đọc truyện từ trái sang phải nhé\nĐây chỉ là một phần nhỏ trong hành trình của Thú Cưng Đặc Biệt – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-18 14:41:50.981679','Thú Cưng Đặc Biệt','Pokemon Special; Pokemon adventures; Pokémon Special; Pocket Monster Special','ĐANG TIẾN HÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/thu-cung-dac-biet-cover.jpg','2024-12-18 14:41:50.981679'),(21,_binary '','Eiichiro Oda (尾田 栄一郎),','Monkey D. Luffy, 1 cậu bé rất thích hải tặc có ước mơ tìm được kho báu One Piece và trở thành Vua hải tặc - Pirate King. Lúc nhỏ, Luffy tình cờ ăn phải trái quỉ (Devil Fruit) Gomu Gomu, nó cho cơ thể cậu khả năng co dãn đàn hồi như cao su nhưng đổi lại cậu sẽ không bao giờ biết bơi. Sau đó Luffy lại được Shank cứu thoát tuy nhiên ông ta bị mất 1 cánh tay. Sau đấy Shank chia tay Luffy và để lại cho cậu cái mũ rơm (Straw Hat) và nói rằng: \"Sau này bao giờ thành cướp biển hãy gặp ta và trả lại nó\". Chính lời nói này đã thúc đầy Luffy trở thành 1 cướp biển thật sự.\nĐây chỉ là một phần nhỏ trong hành trình của One Piece – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-18 14:49:57.492402','One Piece','Vua Hải Tặc; Đảo Hải Tặc; OnePiece','ĐANG TIẾN HÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/one-piece-cover.jpg','2024-12-18 14:49:57.492402'),(22,_binary '','Kishimoto Masashi','Bối cảnh Naruto xảy ra vào mười hai năm trước khi câu chuyện chính thức bắt đầu, một con hồ ly chín đuôi đã tấn công Konohagakure. Nó là một con quái vật có sức mạnh khủng khiếp, chỉ một cái vẫy từ một trong chín cái đuôi của nó có thể tạo ra những cơn sóng thần và san bằng nhiều ngọn núi. Nó gây ra sự hỗn loạn và giết chết rất nhiều người cho đến khi người đứng đầu làng Lá – Hokage đệ tứ – đã đánh bại nó bằng cách đổi lấy mạng sống của mình để phong ấn nó vào trong người một đứa trẻ mới sinh. Đứa trẻ đó tên là Uzumaki Naruto. Bộ truyện kể về cuộc hành trình đầy gian khổ với vô vàn khó khăn, thử thách của Naruto từ khi còn là một cậu bé tới khi trở thành một trong những nhẫn giả vĩ đại nhất. Không chỉ mô tả về một thế giới nhẫn giả huyền bí, Naruto còn mang trong nó nhiều ý nghĩa nhân sinh sâu sắc về tình bạn, tình đồng đội, tình yêu, ước mơ và hi vọng.\nĐây chỉ là một phần nhỏ trong hành trình của Naruto – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-18 14:58:50.035779','Naruto','Naruto - Cửu Vĩ Hồ Ly','HOÀN THÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/naruto-cover.jpg','2024-12-18 14:58:50.035779'),(23,_binary '','Mã Vĩnh Thành','Bạn đang tìm kiếm một bộ truyện tranh vừa mang tính giải trí cao, vừa lôi cuốn với những tình tiết sâu sắc? Hoặc đơn giản chỉ là một bộ truyện có tại NetTruyen? Phong Vân là lựa chọn hoàn hảo dành cho bạn. Được đăng tải và cập nhật liên tục trên NetTruyenViet, đây là một trong những bộ truyện nổi bật đang thu hút đông đảo người hâm mộ.\nTóm tắt nội dung truyện\nTruyện tranh Phong Vân được cập nhật nhanh và đầy đủ nhất tại NetTruyen. Bạn đọc đừng quên để lại bình luận và chia sẻ, ủng hộ NetTruyen ra các chương mới nhất của truyện Phong Vân.\nĐây chỉ là một phần nhỏ trong hành trình của Phong Vân – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-18 15:38:04.642719','Phong Vân','Phong Vân','HOÀN THÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/phong-van-cover.jpg','2024-12-18 15:38:59.734586'),(24,_binary '','Amano Akira','Đây là 1 trong các manga shounen đang “HOT” nhất tại Nhật. Manga nói về Tsunayoshi Sawada, 1 học sinh trung học tầm thường, thường bị mọi người đặt cho biệt danh “Tsuna Vô Dụng”. Vì sự vô dụng này mà mẹ cậu đã thuê 1 gia sư đặc biệc cho Tsuna theo lời quảng cáo trong \"1 tờ rơi\" như sau: “…Sẽ huấn luyện con bạn trở thành 1 thủ lĩnh hàng đầu trong thời đại mới” “Học vấn không là vấn đề. Reborn!” Nhưng… đằng sau đó là 1 sự thật kinh hoàng đang chờ đón Tsuna… “Đừng có mà xem thường. Nghề chính của tui là sát thủ đó. Nhiệm vụ thật sự lần này là đào tạo cậu thành 1 ông chủ Mafia xuất sắc nhất.” “ Còn việc dạy như thế nào là chuyện của tui.” Tương lai và số phận của Tsuna rồi sẽ ra sao… khi cuộc sống luôn cận kệ \"cái chết\" của cậu bắt đầu từ đó...?\nĐây chỉ là một phần nhỏ trong hành trình của Reborn: Người Đào Tạo Sát Thủ – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-18 15:50:28.430374','Reborn: Người Đào Tạo Sát Thủ','Kateikyoushi Hitman Reborn','HOÀN THÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/reborn-nguoi-dao-tao-sat-thu-cover.jpg','2024-12-18 15:50:28.430374'),(25,_binary '','Shimabukuro Mitsutoshi','Câu chuyện kể vể Toriko một thợ săn pro thường xuyên cung cấp các loại thực phẩm quý giá cho nhà hàng và những người giàu có, một anh chàng có đầy sức mạnh để săn bắt các loài động vật hung dữ .\nĐây chỉ là một phần nhỏ trong hành trình của Toriko - Thợ Săn Ẩm Thực – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-18 20:37:49.301916','Toriko - Thợ Săn Ẩm Thực','Toriko - Thợ Săn Ẩm Thực','HOÀN THÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/toriko-tho-san-am-thuc-cover.jpg','2024-12-18 20:37:49.301916'),(26,_binary '','Hoàng Ngọc Lang (黃玉郎)','Truyện tranh Long Hổ 5 Thế được cập nhật nhanh và đầy đủ nhất tại NetTruyen. Bạn đọc đừng quên để lại bình luận và chia sẻ, ủng hộ NetTruyen ra các chương mới nhất của truyện Long Hổ 5 Thế.\nĐây chỉ là một phần nhỏ trong hành trình của Long Hổ 5 Thế – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-18 20:55:13.532908','Long Hổ 5 Thế','Long Hổ 5 Thế','ĐANG TIẾN HÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/long-ho-5-the-cover.jpg','2024-12-18 20:56:22.960073'),(27,_binary '','Sanjo Kiru','Dragon Quest: Dai no Daibouken (Dai\'s Great Adventure) là một bộ manga được vẽ dựa theo loạt game Daragon Quest. Bộ manga này trước đây từng được xuất bản với 2 chương ngắn \"Derupa! Iruiru”. Sau đó, thành công của nó đã dẫn đến việc ra đời thêm 3 chương \"Dai Bakuhatsu!!!\" (Dai Explodes!!!). Cuối cùng thì nó được kéo dài thành bộ Dai no Daibouken gồm 37 tập. Sau này nó cũng được chuyển thể thành anime, cũng là sản phẩm thứ 2 dựa theo series Dragon Quest mà Dragon Quest: Abel Yuusha (được biết đến nhiều với cái tên Dragon Warrior) là sản phẩm đầu tiên.\nĐây chỉ là một phần nhỏ trong hành trình của Dấu Ấn Rồng Thiêng – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-18 21:32:20.173614','Dấu Ấn Rồng Thiêng','Dragon Quest','ĐANG TIẾN HÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/dau-an-rong-thieng-cover.jpg','2024-12-18 21:32:20.171606'),(28,_binary '','Kusaba Michiteru','Một bộ truyện tranh đã được mong chờ từ lâu nhưng vì không có bản VIp nên vẫn chưa ai đăng, nay tui mạo hiểm đăng bản scan của vuilen.com cho mọi người đọc, hy vọng chất lượng nội dung sẽ bù chất lượng hình ảnh ( 2 Chap đầu là bản V.I.P). Nhân vật chính là Một chàng trai trẻ bước vào cuộc phiêu lưu mới trên đấu trường bóng đá quốc tế. Cậu bé lọt vào mắt xanh của người chuyên tìm kiếm tài năng trẻ cho CLB thành MILAN, đó chính là ...\nĐây chỉ là một phần nhỏ trong hành trình của Fantasista – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-18 21:47:10.598536','Fantasista','Fantasista','ĐANG TIẾN HÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/fantasista-cover.jpg','2024-12-18 21:48:00.158458'),(29,_binary '','Hà Chí Văn','Cuối thời Nam Tống, Mông cổ xâm lược, dân chúng loạn lạc. Ma Giới Kim Điển tái xuất giang hồ. Phong ba nổi lên, Loạn thế xuất anh hùng.\nĐây chỉ là một phần nhỏ trong hành trình của Tuyệt Thế Vô Song – câu chuyện còn ẩn chứa nhiều bất ngờ và kịch tính hơn nữa, chắc chắn sẽ khiến bạn không thể rời mắt.','2024-12-18 21:55:17.891026','Tuyệt Thế Vô Song','Tuyệt Thế Vô Song','ĐANG TIẾN HÀNH','https://my-truyen247-springboot.s3.ap-southeast-2.amazonaws.com/tuyet-the-vo-song-cover.jpg','2024-12-18 22:27:03.622476');
