INSERT INTO `genres` VALUES (2,'2024-11-18 20:35:39.688011','**Manhua** là một thể loại truyện tranh xuất phát từ Trung Quốc, mang đặc trưng văn hóa và nghệ thuật Á Đông. So với các thể loại truyện tranh khác như Manga (Nhật Bản) hay Manhwa (Hàn Quốc), Manhua nổi bật với phong cách minh họa mềm mại, chi tiết và sử dụng màu sắc sống động, thường là tranh màu toàn bộ. Nội dung của Manhua rất đa dạng, từ cổ trang, huyền huyễn, võ hiệp, tiên hiệp cho đến hiện đại, tình cảm, hài hước và hành động. Nhiều tác phẩm Manhua lấy cảm hứng từ văn học cổ điển, lịch sử Trung Quốc hoặc truyền thuyết dân gian, tạo nên một không gian giàu tính truyền thống kết hợp với yếu tố hiện đại. Những đặc trưng này giúp Manhua không chỉ thu hút người đọc trong nước mà còn tạo được dấu ấn mạnh mẽ trên thị trường quốc tế, đặc biệt là trong cộng đồng yêu thích văn hóa Trung Hoa.','Manhua','2024-12-15 08:36:36.717729'),(3,'2024-11-18 20:35:44.074476','Thể loại truyện **Adventure** (phiêu lưu) thường xoay quanh hành trình của nhân vật chính trên con đường khám phá thế giới mới, đối mặt với những thử thách nguy hiểm và chinh phục những mục tiêu lớn lao. Trong những câu chuyện này, nhân vật thường rời xa vùng an toàn của mình để bước vào những miền đất xa lạ, nơi họ phải đối mặt với những thế lực siêu nhiên, thiên nhiên khắc nghiệt hoặc kẻ thù bí ẩn. Cốt truyện thường kịch tính, giàu yếu tố bất ngờ, đẩy nhân vật vào tình huống đòi hỏi lòng can đảm, sự thông minh và kỹ năng sinh tồn. Thể loại phiêu lưu không chỉ mang đến những giây phút hồi hộp mà còn truyền tải những bài học sâu sắc về nghị lực, tình bạn và sự trưởng thành qua những hành trình đầy cảm hứng. Đây là thể loại lý tưởng cho những độc giả yêu thích sự hồi hộp, đam mê khám phá và khát vọng vượt qua giới hạn của bản thân.','Adventure ','2024-11-23 15:23:50.628601'),(4,'2024-11-18 20:35:47.230766','**Thể loại truyện Cooking** là một dòng truyện hấp dẫn, xoay quanh thế giới ẩm thực đầy màu sắc và phong phú. Các câu chuyện thường tập trung vào hành trình của nhân vật chính, những đầu bếp tài năng hoặc những người đam mê nấu nướng, vượt qua thử thách để khám phá và sáng tạo ra những món ăn độc đáo. Thể loại này không chỉ khắc họa sự tinh tế trong nghệ thuật ẩm thực mà còn truyền tải thông điệp về đam mê, sự kiên trì và tình yêu dành cho hương vị. Truyện Cooking thường đan xen giữa kiến thức nấu ăn, các màn thi đấu ẩm thực căng thẳng, và cả những câu chuyện cảm động về gia đình, bạn bè, hoặc tình yêu. Đây là thể loại phù hợp với những ai yêu thích ẩm thực, khao khát tìm hiểu văn hóa qua các món ăn, hoặc đơn giản là muốn cảm nhận sức mạnh kết nối của ẩm thực trong cuộc sống.','Cooking','2024-11-23 15:24:08.076424'),(5,'2024-11-18 20:35:55.566697','Thể loại truyện Anime là một dạng văn học độc đáo kết hợp giữa hình ảnh minh họa sinh động và cốt truyện phong phú, thường được chuyển thể từ manga (truyện tranh Nhật Bản). Điểm đặc trưng của thể loại này là sự đa dạng trong chủ đề, từ hành động, phiêu lưu, kỳ ảo đến tình cảm lãng mạn, hài hước, hoặc các câu chuyện tâm lý sâu sắc. Nhân vật trong anime thường được xây dựng với vẻ ngoài đặc biệt, mang phong cách nghệ thuật đặc trưng của Nhật Bản, như đôi mắt to, biểu cảm rõ nét, và trang phục ấn tượng. Anime không chỉ giới hạn ở các đối tượng trẻ tuổi mà còn chạm đến nhiều khán giả trưởng thành, nhờ những câu chuyện đậm chất nhân văn, phản ánh các vấn đề xã hội hoặc mang ý nghĩa triết học sâu sắc. Sức hấp dẫn của anime còn nằm ở cách kể chuyện sáng tạo, lôi cuốn, kết hợp âm nhạc và hình ảnh để tạo nên trải nghiệm cảm xúc trọn vẹn cho người xem.','Anime','2024-11-23 15:24:26.196548'),(6,'2024-11-18 20:35:58.072330','Thể loại truyện **Comedy** (Hài hước) là một trong những dòng truyện mang tính giải trí cao, được xây dựng dựa trên những tình huống dí dỏm, lời thoại châm biếm hoặc các pha hài hước độc đáo. Truyện Comedy thường khai thác những khía cạnh vui vẻ trong cuộc sống, lồng ghép các câu chuyện đời thường, các tình tiết bất ngờ hoặc những nhân vật với tính cách \"lố\" một cách đáng yêu. Điểm đặc trưng của thể loại này là tạo nên tiếng cười sảng khoái, giúp độc giả thư giãn và thoát khỏi áp lực thường nhật. Dù mang màu sắc nhẹ nhàng, Comedy vẫn có thể truyền tải những thông điệp sâu sắc qua cách nhìn lạc quan và vui tươi về cuộc sống.','Comedy','2024-11-23 15:24:50.933069'),(7,'2024-11-19 13:02:16.441499','Manga là thể loại truyện tranh xuất phát từ Nhật Bản, nổi tiếng với phong cách vẽ đặc trưng, cốt truyện đa dạng và sâu sắc. Truyện manga thường được xuất bản dưới dạng tạp chí hoặc tập truyện, phục vụ mọi độ tuổi và sở thích với nhiều thể loại như hành động, phiêu lưu, tình cảm, kinh dị, giả tưởng và hài hước. Một điểm độc đáo của manga là cách đọc từ phải sang trái, giữ nguyên nét văn hóa truyền thống Nhật Bản. Không chỉ là một hình thức giải trí, manga còn là phương tiện truyền tải các thông điệp xã hội và cảm xúc, thu hút hàng triệu người hâm mộ trên toàn thế giới.','Manga','2024-11-19 13:03:25.761508'),(8,'2024-11-19 13:02:45.880902','**Truyện trinh thám** là thể loại văn học hấp dẫn xoay quanh những vụ án ly kỳ, bí ẩn, thường liên quan đến tội phạm hoặc những bí mật cần giải mã. Điểm đặc trưng của truyện trinh thám là sự xuất hiện của nhân vật chính – thường là thám tử, cảnh sát, hoặc những người có tư duy logic sắc bén – dẫn dắt người đọc qua từng manh mối để khám phá sự thật. Thể loại này không chỉ thử thách khả năng suy luận mà còn mang lại cảm giác hồi hộp, cuốn hút với những tình tiết bất ngờ, gay cấn. Truyện trinh thám phù hợp với độc giả yêu thích sự tư duy và khám phá những câu chuyện đầy bí ẩn.','Trinh Thám','2024-11-19 13:02:45.880902'),(9,'2024-11-19 13:03:57.388356','**Drama** là thể loại truyện tập trung vào khai thác sâu sắc tâm lý nhân vật và những tình huống căng thẳng, đầy cảm xúc. Các câu chuyện thường xoay quanh những mâu thuẫn phức tạp trong gia đình, tình yêu, hoặc xã hội, mang đến sự đồng cảm mạnh mẽ và cảm giác gần gũi cho người đọc. Với nội dung chân thực và đôi khi đau lòng, drama khiến người đọc suy ngẫm về các giá trị cuộc sống và mối quan hệ con người. Thể loại này phù hợp với những ai yêu thích sự sâu lắng và những câu chuyện giàu ý nghĩa.','Drama','2024-11-19 13:03:57.388356'),(10,'2024-11-23 15:38:09.447221','Fantasy là một thể loại truyện thường gắn liền với những yếu tố siêu nhiên, huyền bí và thế giới tưởng tượng, nơi phép thuật, quái vật, và những nhân vật phi thường trở thành tâm điểm. Những câu chuyện Fantasy thường diễn ra trong các vương quốc xa lạ, nơi các anh hùng dấn thân vào hành trình chống lại thế lực bóng tối hoặc tìm kiếm sự thật về thân thế của mình. Đây là thể loại giúp người đọc thoát khỏi thực tại, hòa mình vào thế giới đầy màu sắc của các vị thần, tiên nữ, rồng, và những hiện tượng vượt ngoài giới hạn của khoa học. Từ những cuộc phiêu lưu kỳ thú đến các mâu thuẫn nội tâm sâu sắc, truyện Fantasy khơi dậy trí tưởng tượng vô tận, đồng thời gửi gắm những thông điệp về lòng can đảm, tình bạn, và sự hy sinh.','Fantasy','2024-11-23 15:38:09.446224'),(11,'2024-11-23 15:38:40.215555','**Truyện khoa học viễn tưởng (Sci-fi)** là thể loại văn học khám phá các ý tưởng khoa học, công nghệ và những khả năng vượt xa thực tế hiện tại, thường được đặt trong bối cảnh tương lai, không gian vũ trụ, hoặc thế giới giả tưởng. Điểm đặc trưng của thể loại này là sự kết hợp giữa các yếu tố khoa học, triết học và xã hội học, nhằm phản ánh hoặc đặt câu hỏi về mối quan hệ giữa con người, công nghệ và vũ trụ. Các tác phẩm Sci-fi thường đề cập đến các chủ đề như trí tuệ nhân tạo, du hành thời gian, người ngoài hành tinh, thám hiểm không gian, hoặc những đột phá công nghệ có thể thay đổi cuộc sống. Bằng cách mở rộng trí tưởng tượng và khai thác các giả thuyết khoa học, Sci-fi không chỉ mang lại sự hồi hộp, kỳ thú mà còn truyền tải những thông điệp sâu sắc về nhân sinh quan và tương lai của nhân loại.','Sci-fi','2024-11-23 15:38:40.215555'),(12,'2024-11-23 15:39:07.821623','**Slice of Life** là một thể loại truyện tập trung vào việc tái hiện những khoảnh khắc, cảm xúc và trải nghiệm trong cuộc sống đời thường của con người. Thay vì theo đuổi những câu chuyện kịch tính, đầy biến cố hay phiêu lưu, Slice of Life tôn vinh sự giản dị, chân thực, và gần gũi trong các mối quan hệ, sinh hoạt thường nhật hoặc những thay đổi nhỏ nhưng ý nghĩa trong cuộc sống. Các tác phẩm thuộc thể loại này thường khai thác sâu vào tâm lý nhân vật, mang đến cho người đọc cảm giác đồng cảm, bình yên và suy ngẫm. Đây là thể loại đặc biệt phù hợp với những ai yêu thích sự nhẹ nhàng, chân thực, và tìm kiếm giá trị trong những điều tưởng chừng như bình dị nhất.','Slice of Life','2024-11-23 15:39:07.821623'),(13,'2024-12-08 18:54:56.765732','Truyện Shounen là một thể loại manga hoặc anime chủ yếu dành cho đối tượng nam giới trẻ, với các yếu tố hành động, phiêu lưu và phát triển nhân vật nổi bật. Câu chuyện thường xoay quanh những nhân vật nam trẻ tuổi, mạnh mẽ, đầy nhiệt huyết và có ước mơ lớn lao, như trở thành chiến binh vĩ đại, anh hùng cứu thế, hay người đứng đầu trong lĩnh vực nào đó. Những thử thách, cuộc chiến đấu cam go và mối quan hệ bạn bè, tình đồng đội là điểm nhấn của thể loại này. Mỗi nhân vật thường phải đối mặt với các cuộc thử thách để vượt qua giới hạn bản thân, qua đó truyền tải thông điệp về sự kiên trì, lòng dũng cảm và tinh thần vượt qua nghịch cảnh.','Shounen','2024-12-08 18:54:56.760749'),(14,'2024-12-08 18:55:31.485380','Truyện Supernatural thường xoay quanh những hiện tượng kỳ bí, siêu nhiên và thế giới vượt ra ngoài giới hạn của thực tại. Nhân vật chính có thể là những người sở hữu năng lực đặc biệt, hoặc họ đối mặt với những sinh vật huyền bí như ma quái, quái vật, thiên thần, hoặc ác quỷ. Câu chuyện thường kết hợp giữa yếu tố hành động, tâm lý và những câu hỏi về số phận, sự sống và cái chết, đồng thời khai thác sâu sắc những xung đột nội tâm và cuộc chiến giữa cái thiện và cái ác. Thế giới trong truyện Supernatural có thể đầy rẫy nguy hiểm, nhưng cũng là nơi thể hiện sức mạnh của lòng dũng cảm và tình yêu thương.','Supernatural','2024-12-08 18:55:31.485380'),(15,'2024-12-13 21:12:45.492422','Truyện *School Life* là thể loại xoay quanh cuộc sống học đường, nơi các nhân vật chủ yếu là học sinh, sinh viên, và những tình huống diễn ra trong môi trường học tập. Những câu chuyện thường tập trung vào mối quan hệ giữa các nhân vật, từ tình bạn, tình yêu cho đến những xung đột, thử thách trong học tập và cuộc sống cá nhân. Thể loại này không chỉ khắc họa những khoảnh khắc vui tươi, ngây ngô của tuổi học trò mà còn đề cập đến những vấn đề sâu sắc như ước mơ, áp lực học hành, sự trưởng thành và những thay đổi trong cuộc sống. Truyện *School Life* mang đến sự gần gũi, dễ dàng kết nối với mọi người, đặc biệt là những bạn trẻ, qua những câu chuyện đầy cảm xúc và bài học về tình bạn, tình yêu và những khát vọng tuổi trẻ.','School Life','2024-12-13 21:12:45.492422'),(16,'2024-12-13 21:29:55.998553','Thể loại truyện **Thiếu Nhi** là dòng truyện dành riêng cho trẻ em, thường mang nội dung nhẹ nhàng, vui tươi và giàu tính giáo dục. Các câu chuyện trong thể loại này thường xoay quanh cuộc sống thường ngày, những cuộc phiêu lưu kỳ thú, tình bạn, gia đình hoặc bài học đạo đức. Ngôn ngữ truyện đơn giản, dễ hiểu, kết hợp với hình ảnh minh họa sinh động để thu hút trẻ nhỏ. Truyện thiếu nhi không chỉ giúp các em phát triển trí tưởng tượng mà còn gieo vào tâm hồn trẻ những giá trị tốt đẹp như lòng nhân ái, sự trung thực và tinh thần vượt khó.','Thiếu Nhi','2024-12-13 21:29:55.997546'),(17,'2024-12-16 21:02:22.406292','Thể loại **truyện Action** (Hành động) thường xoay quanh những tình tiết kịch tính, nhịp độ nhanh và các pha hành động mãn nhãn. Nhân vật trong truyện thường phải đối mặt với các thử thách cam go, từ những trận chiến khốc liệt, các màn rượt đuổi gay cấn đến những âm mưu phức tạp. Điểm nhấn của thể loại này là sự căng thẳng, hồi hộp và yếu tố bất ngờ, giữ cho độc giả luôn ở trong trạng thái mong chờ. Ngoài các pha hành động, truyện còn kết hợp yếu tố cảm xúc như lòng dũng cảm, ý chí sinh tồn và tình đồng đội, tạo nên một câu chuyện vừa mạnh mẽ vừa lôi cuốn.','Action','2024-12-16 21:02:22.406292'),(19,'2024-12-18 00:03:22.652695','**Truyện scan** là thể loại truyện tranh được các nhóm dịch hoặc cá nhân sưu tầm từ bản gốc nước ngoài, thường dưới dạng bản in hoặc bản kỹ thuật số, sau đó được quét (scan), dịch thuật và chỉnh sửa lại để phù hợp với ngôn ngữ của người đọc. Loại truyện này chủ yếu được chia sẻ miễn phí trên các nền tảng đọc truyện online. Điểm đặc trưng của truyện scan là tốc độ cập nhật nhanh, giúp độc giả tiếp cận sớm với các tác phẩm nổi tiếng từ các quốc gia như Nhật Bản, Hàn Quốc, Trung Quốc,... Thể loại này đặc biệt phổ biến với các fan hâm mộ truyện tranh, nhưng đôi khi cũng gặp phải vấn đề về bản quyền do chưa được sự cho phép chính thức từ tác giả hoặc nhà xuất bản.','Truyện scan','2024-12-18 00:03:22.651687'),(20,'2024-12-18 14:01:58.768326','Thể loại truyện **Mystery** (Trinh thám/Bí ẩn) thường xoay quanh những bí ẩn cần được giải đáp, như vụ án mạng, mất tích, hoặc những hiện tượng kỳ bí. Các tác phẩm trong thể loại này thường chứa đựng sự hồi hộp, kịch tính, và những tình tiết bất ngờ, thu hút người đọc vào hành trình khám phá sự thật. Nhân vật chính thường là thám tử, nhà điều tra, hoặc một người bình thường bị cuốn vào sự kiện, sử dụng tư duy logic và các manh mối để giải mã bí ẩn. Đặc trưng của thể loại này là bầu không khí bí ẩn, cốt truyện chặt chẽ, và những bước ngoặt đầy kịch tính, khiến độc giả không thể rời mắt cho đến khi mọi chuyện sáng tỏ.','Mystery','2024-12-18 14:01:58.768326'),(21,'2024-12-18 15:38:45.144579','Thể loại truyện **Martial Arts** (Võ thuật) tập trung vào các cuộc chiến đấu, kỹ năng võ thuật và hành trình tu luyện của các nhân vật. Những câu chuyện này thường xoay quanh các nhân vật chính, thường là những người võ sĩ hoặc anh hùng, với mục tiêu đạt được sự hoàn thiện về sức mạnh, kỹ năng và tinh thần. Các cuộc chiến đấu trong truyện không chỉ là những trận đấu thể lực mà còn là sự đối đầu về trí tuệ, chiến thuật và nội tâm. Thể loại này thường có những yếu tố huyền bí, siêu nhiên hoặc phép thuật, nơi nhân vật có thể học những chiêu thức đặc biệt hoặc đạt được sức mạnh vô song. Cốt truyện trong thể loại võ thuật thường đầy kịch tính, với những cuộc phiêu lưu, thách thức và sự tranh đấu để bảo vệ công lý hoặc tìm kiếm danh vọng.','Martial Arts','2024-12-18 15:38:45.144579'),(22,'2024-12-18 20:56:10.585989','**Truyện Màu** là thể loại truyện tranh được minh họa bằng màu sắc sống động, tạo cảm giác chân thực và cuốn hút cho người đọc. Không chỉ truyền tải nội dung qua lời thoại và hình ảnh, màu sắc trong truyện giúp thể hiện cảm xúc, không khí, và làm nổi bật các chi tiết quan trọng. Thể loại này thường xuất hiện trong các webtoon, truyện tranh hiện đại hoặc các tác phẩm được chuyển thể từ truyện chữ, phù hợp với nhiều đề tài như hành động, lãng mạn, phiêu lưu hay kỳ ảo. Truyện Màu mang lại trải nghiệm thị giác độc đáo, giúp người đọc dễ dàng hòa mình vào thế giới truyện và cảm nhận sâu sắc hơn câu chuyện.','Truyện Màu','2024-12-18 20:56:10.585989'),(23,'2024-12-18 21:47:47.544346','Thể loại truyện **Sports** (Thể thao) tập trung vào hành trình chinh phục ước mơ, vượt qua thử thách và phát triển bản thân của các nhân vật trong môi trường thể thao. Nội dung thường xoay quanh những trận đấu kịch tính, sự cạnh tranh khốc liệt, tinh thần đồng đội và khát vọng chiến thắng. Các câu chuyện không chỉ tôn vinh kỹ năng, chiến thuật trong môn thể thao mà còn khai thác sâu sắc cảm xúc, tình bạn, và giá trị của sự nỗ lực không ngừng. Thể loại này truyền cảm hứng mạnh mẽ, khuyến khích người đọc theo đuổi đam mê và vượt qua giới hạn của chính mình.','Sports','2024-12-18 21:47:47.543344');
